sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
var gr = new GlideRecord(inputs.table_name);
gr.addQuery('sys_id', inputs.record_id);
gr.query();

if (gr.next()) {
    gs.eventQueue(
        inputs.event_id,
        gr,
        inputs.parameter_1,
        inputs.parameter_2
    );

  outputs.response_message = "Success";
}
})(inputs, outputs);

